                <p> </p>
                <p><strong>1) Заказ по телефону.</strong></p>
                <p>Вы можете сделать заказ по одному из телефонов службы доставки:</p>
                <p><a href=""tel:+7(906)5300080"">8 (906) 530-00-80</a></p>
                <p><a href=""tel:+7(960)5950202"">8 (960) 595-02-02</a></p>
                <p> </p>
                <p><strong>2) Онлайн заказ</strong></p>
                <p>Минимальная сумма заказа 500 рублей.</p>
                <p>Добавьте в корзину понравившиеся блюда из нашего меню, указав количество и нажав кнопку «ЗАКАЗАТЬ».</p>
